import React from 'react'
import Row, {Container} from "react-bootstrap";
import Col from "react-bootstrap";

class App extends React.Component {
    render() {
        return (
            <Container fluid>
                <Row>
                   <Col>
                      <pre>Hello world</pre>
                   </Col>
                </Row>
            </Container>
        )
    }
}

export default App;
